<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8">
    <title>3D Point Cloud Visualization</title>
    <style>
        body { 
            margin: 0; 
            overflow: hidden;
            font-family: Arial, sans-serif;
        }
        #info {
            position: absolute;
            top: 10px;
            left: 10px;
            color: white;
            background: rgba(0,0,0,0.7);
            padding: 10px;
            border-radius: 5px;
            z-index: 100;
        }
        #controls {
            position: absolute;
            bottom: 10px;
            left: 10px;
            color: white;
            background: rgba(0,0,0,0.7);
            padding: 10px;
            border-radius: 5px;
            z-index: 100;
            font-size: 12px;
        }
        #coordinates {
            position: absolute;
            bottom: 10px;
            right: 10px;
            color: white;
            background: rgba(0,0,0,0.7);
            padding: 10px;
            border-radius: 5px;
            z-index: 100;
            font-size: 12px;
            min-width: 150px;
        }
        #categoryPanel {
            position: absolute;
            top: 10px;
            right: 10px;
            background: rgba(26, 26, 26, 0.95);
            color: white;
            padding: 15px;
            border-radius: 8px;
            z-index: 100;
            max-height: calc(100vh - 20px);
            overflow-y: auto;
            min-width: 250px;
            max-width: 350px;
        }
        #categoryPanel h3 {
            margin: 0 0 10px 0;
            color: #4fc3f7;
            font-size: 16px;
        }
        #categoryTable {
            width: 100%;
            border-collapse: collapse;
            font-size: 12px;
        }
        #categoryTable th {
            background: #2a2a2a;
            padding: 6px 8px;
            text-align: left;
            font-size: 11px;
        }
        #categoryTable td {
            padding: 4px 8px;
            border-bottom: 1px solid #333;
        }
        #categoryTable tr:hover {
            background: rgba(79, 195, 247, 0.1);
        }
        .color-swatch {
            display: inline-block;
            width: 12px;
            height: 12px;
            border-radius: 2px;
            margin-right: 6px;
        }
    </style>
</head>

        // Scene setup
        const scene = new THREE.Scene();
        scene.background = new THREE.Color(0x1a1a1a);
        
        const camera = new THREE.PerspectiveCamera(
            75, 
            window.innerWidth / window.innerHeight, 
            1,
            10000000
        );
        
        const renderer = new THREE.WebGLRenderer({ antialias: true });
        renderer.setSize(window.innerWidth, window.innerHeight);
        document.body.appendChild(renderer.domElement);
        
        // Orbit controls
        const controls = new THREE.OrbitControls(camera, renderer.domElement);
        controls.enableDamping = true;
        controls.dampingFactor = 0.05;
        
        // Lighting
        const ambientLight = new THREE.AmbientLight(0x404040, 2);
        scene.add(ambientLight);
        
        const directionalLight = new THREE.DirectionalLight(0xffffff, 1);
        directionalLight.position.set(1, 1, 1);
        scene.add(directionalLight);
        
        // Calculate world bounds from point data
        let minX = Infinity, maxX = -Infinity;
        let minY = Infinity, maxY = -Infinity;
        let minZ = Infinity, maxZ = -Infinity;
        
        pointData.forEach(point => {
            minX = Math.min(minX, point.p[0]);
            maxX = Math.max(maxX, point.p[0]);
            minY = Math.min(minY, point.p[1]);
            maxY = Math.max(maxY, point.p[1]);
            minZ = Math.min(minZ, point.p[2]);
            maxZ = Math.max(maxZ, point.p[2]);
        });
        
        const worldWidth = maxX - minX;
        const worldHeight = maxY - minY;
        const worldDepth = maxZ - minZ;
        const worldSize = Math.max(worldWidth, worldHeight, worldDepth);
        
        // Grid scaled to world size
        const gridSize = Math.ceil(worldSize * 1.2);
        const gridDivisions = Math.min(100, Math.max(20, Math.floor(gridSize / 100)));
        const gridHelper = new THREE.GridHelper(gridSize, gridDivisions, 0x444444, 0x222222);
        gridHelper.rotation.x = Math.PI / 2;
        scene.add(gridHelper);
        
        // Scale compass labels based on world size
        const compassScale = worldSize * 0.05;
        const compassDistance = gridSize / 2;
        
        // Create compass labels as sprites
        function createTextSprite(text, color, scale) {
            const canvas = document.createElement('canvas');
            const context = canvas.getContext('2d');
            canvas.width = 256;
            canvas.height = 256;
            
            context.font = 'Bold 120px Arial';
            context.fillStyle = color;
            context.textAlign = 'center';
            context.textBaseline = 'middle';
            context.fillText(text, 128, 128);
            
            const texture = new THREE.CanvasTexture(canvas);
            const spriteMaterial = new THREE.SpriteMaterial({ map: texture });
            const sprite = new THREE.Sprite(spriteMaterial);
            sprite.scale.set(scale, scale, 1);
            
            return sprite;
        }
        
        // Add compass labels
        const compassHeight = worldSize * 0.01;
        
        const compassN = createTextSprite('N', '#ff6b6b', compassScale);
        compassN.position.set(0, -compassDistance, compassHeight);
        scene.add(compassN);
        
        const compassS = createTextSprite('S', '#ffffff', compassScale);
        compassS.position.set(0, compassDistance, compassHeight);
        scene.add(compassS);
        
        const compassE = createTextSprite('E', '#ffffff', compassScale);
        compassE.position.set(-compassDistance, 0, compassHeight);
        scene.add(compassE);
        
        const compassW = createTextSprite('W', '#ffffff', compassScale);
        compassW.position.set(compassDistance, 0, compassHeight);
        scene.add(compassW);
        
        // Create point cloud particles grouped by category
        const particleGroups = new Map();
        
        pointData.forEach(point => {
            const category = point.c;
            
            if (!particleGroups.has(category)) {
                particleGroups.set(category, {
                    color: point.l,
                    points: []
                });
            }
            
            particleGroups.get(category).points.push(point.p);
        });
        
        // Create particle systems for each category
        const particles = [];
        const categoryColorMap = new Map();
        
        particleGroups.forEach((data, category) => {
            const positions = new Float32Array(data.points.length * 3);
            data.points.forEach((pos, i) => {
                positions[i * 3] = pos[0];
                positions[i * 3 + 1] = pos[1];
                positions[i * 3 + 2] = pos[2];
            });
            
            const geometry = new THREE.BufferGeometry();
            geometry.setAttribute('position', new THREE.BufferAttribute(positions, 3));
            
            const material = new THREE.PointsMaterial({
                color: data.color,
                size: 8,
                sizeAttenuation: true
            });
            
            const particleSystem = new THREE.Points(geometry, material);
            particleSystem.userData = {
                category: category,
                count: data.points.length
            };
            
            scene.add(particleSystem);
            particles.push(particleSystem);
            categoryColorMap.set(category, data.color);
        });
        
        document.getElementById('pointCount').textContent = pointData.length;
        
        // Populate category table
        const categoryTableBody = document.getElementById('categoryTableBody');
        const sortedCategories = Array.from(particleGroups.keys()).sort();
        
        sortedCategories.forEach(category => {
            const count = particleGroups.get(category).points.length;
            const color = categoryColorMap.get(category);
            const hexColor = '#' + color.toString(16).padStart(6, '0');
            
            const row = document.createElement('tr');
            row.innerHTML = `
                <td><input type="checkbox" class="category-toggle" data-category="${category}" checked></td>
                <td>
                    <span class="color-swatch" style="background-color: ${hexColor}"></span>
                    ${category}
                </td>
                <td>${count}</td>
            `;
            categoryTableBody.appendChild(row);
        });
        
        // Toggle particle visibility by category
        document.querySelectorAll('.category-toggle').forEach(checkbox => {
            checkbox.addEventListener('change', (e) => {
                const category = e.target.dataset.category;
                const checked = e.target.checked;
                particles.forEach(particle => {
                    if (particle.userData.category === category) {
                        particle.visible = checked;
                    }
                });
            });
        });
        
        // Toggle all particles
        document.getElementById('toggleAll').addEventListener('change', (e) => {
            const checked = e.target.checked;
            document.querySelectorAll('.category-toggle').forEach(checkbox => {
                checkbox.checked = checked;
            });
            particles.forEach(particle => {
                particle.visible = checked;
            });
        });
        
        // Size attenuation toggle
        document.getElementById('sizeAttenuation').addEventListener('change', (e) => {
            particles.forEach(particle => {
                particle.material.sizeAttenuation = e.target.checked;
            });
        });
        
        // Position camera
        camera.up.set(0, -1, 0);
        const cameraDistance = worldSize * 0.8;
        camera.position.set(0, 0, cameraDistance);
        controls.target.set(0, 0, 0);
        controls.update();
        
        // Mouse position tracking
        const raycaster = new THREE.Raycaster();
        const mouse = new THREE.Vector2();
        const groundPlane = new THREE.Plane(new THREE.Vector3(0, 0, 1), 0);
        const intersectionPoint = new THREE.Vector3();
        
        window.addEventListener('mousemove', (event) => {
            mouse.x = (event.clientX / window.innerWidth) * 2 - 1;
            mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;
            
            raycaster.setFromCamera(mouse, camera);
            
            if (raycaster.ray.intersectPlane(groundPlane, intersectionPoint)) {
                const gameX = -intersectionPoint.x;
                const gameY = intersectionPoint.y;
                
                document.getElementById('coord-x').textContent = Math.round(gameX);
                document.getElementById('coord-y').textContent = Math.round(gameY);
            }
        });
        
        // Handle window resize
        window.addEventListener('resize', () => {
            camera.aspect = window.innerWidth / window.innerHeight;
            camera.updateProjectionMatrix();
            renderer.setSize(window.innerWidth, window.innerHeight);
        });
        
        // Animation loop
        function animate() {
            requestAnimationFrame(animate);
            controls.update();
            renderer.render(scene, camera);
        }
        animate();
    </script>
